Le produit intérieur brut (PIB) est l'indicateur économique qui permet de quantifier la valeur totale de la « production de richesse » annuelle effectuée par les agents économiques (ménages, entreprises, administrations publiques) résidant à l'intérieur d'un territoire. Le produit intérieur brut est le principal indicateur de la mesure de la production économique réalisée à l’intérieur d'un pays et l'un des agrégats majeurs des comptes nationaux. Le PIB reflète donc l'activité économique interne d'un pays et la variation du PIB d'une période à l'autre est censée mesurer son taux de croissance économique. Il diffère du revenu national brut (RNB) qui ajoute au PIB (produit intérieur brut) les entrées nettes de revenus de facteurs en provenance de l'étranger (revenus de facteurs provenant du reste du monde diminués des revenus de facteurs payés au reste du monde). La composition de cet indice est dans certains cas sujette à caution ou à suspicion, en particulier lorsque les gouvernements y voient un outil politique et qu'ils ont la capacité d'influencer la production de cet indicateur. La notion de PIB fait l'objet de contestations : 
* le PIB comme indicateur de production de richesse ne considère qu'une partie de la valeur créée par l'activité économique et de plus qu'une valeur déterminée de façon comptable ; 
* les activités dites « négatives » (par exemple des dépenses liées aux accidents domestiques, industriels ou routiers) sont comptabilisées, tandis que les activités positives à la fois non marchandes et non administratives, comme l'art ou les activités altruistes (par exemple le logiciel libre) ou les activités bénévoles, ou encore la production domestique assurée au quotidien au sein de la famille, ne le sont pas ; 
* les défenseurs de l'environnement et du développement durable critiquent le produit intérieur brut comme mesure de la « production de richesse » : bien que la production économique consomme en partie le capital naturel, le PIB ne tient pas compte des effets de cette consommation. Le Comité d'experts des Nations unies sur la comptabilité environnementale-économique (UNCEEA) travaille à définir un indicateur qui tienne compte des effets sur l'environnement, le Produit intérieur brut vert et à faire du Système de comptabilité environnementale économique (SEEA) un standard international pour l'année 2010 et à promouvoir sa mise en œuvre dans les pays.
